import { GithubIcon } from '../../icons/Github';
import { LinkedIn } from '../../icons/LinkedIn';
import { PageContainer, LinkContainer, GreetingContent,TextContent } from './styles';

const About = () => {
  return (
    <PageContainer>
      <GreetingContent>Hi, I'm Steven</GreetingContent>
      <TextContent>I've always loved solving problems and being a technophile who was obsessed with the latest tech.</TextContent>
      <LinkContainer>
        <GithubIcon />
        <LinkedIn />
      </LinkContainer>
      <h1>About Me</h1>
      <section>
        {/* I'm relatively new to the world of web dev and programming in general, but I've gained a lot of experience from maintaining open source projects and their documentation sites. I like types, utility classes, multi-page applications, markdown, and Safari. I think I'm a fullstack developer but that's more out of necessity. */}
        {/* <br />
        <br />
        When I don't have VSCode or Github open, I enjoy taking photos, drawing, playing games, traveling, and cooking. Italian cuisine is my favorite.
        <br />
        <br />
        Feel free to message me on Twitter or Discord! */}
      </section>
    </PageContainer>
  );
};

export default About;
